import styled from "styled-components"

export const Button = styled.button`
    position: fixed;
    left: 50px;
    right: 50px;
    width:50px;
    height:50px;
    font-size: 100px;
    background-color: rgba(51,51,51,0.3);
    backdrop-filter: blur(1px);
    display: flex;
    align-items: center;
    justify-content: center;
    opacity: 1;
`
